import React from "react";
import classes from "./pagination.module.scss";
import GreenOval from "../trifles/GreenOval";

const Pagination = () => {
  return (
    <div className={classes.pagination}>
      <div>
        <span>Page: </span>
        <button>1</button>
        <button>2</button>
        <button>3</button>
        <button>4</button>
      </div>
      <div>
        <GreenOval>336</GreenOval>
        <span> Products</span>
      </div>
    </div>
  );
};

export default Pagination;
